import React from 'react';

const Header = () => {
    return (
        <header className='flex justify-between items-center p-4 bg-gray-900 text-white'>
            <h1 className='text-xl font-bold'>My Movie App</h1>
            <nav>
                <ul className='flex gap-4'>
                    <li>
                        <a href='#'>Home</a>
                    </li>
                    <li>
                        <a href='#'>About</a>
                    </li>
                    <li>
                        <a href='#'>Contact</a>
                    </li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
